    false,nt"url": null,nt"notes": "NODC Accession 0141434 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard NOAA Ship Okeanos Explorer in the Caribbean Sea, Coastal
    Waters of SE Alaska, North Atlantic Ocean and North Pacific Ocean from 2015-05-08
    to 2015-06-09. Office of Marine and Aviation Operations (OMAO) personnel aboard
    the ship submitted these data and associated metadata to NODC. In addition, NODC
    Accession 0141434 contains supplementary cruise-level metadata, which OMAO personnel
    logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel developed
    the automated process to archive these data under the auspices of the NOAA Rolling
    Deck to Repository (NOAA R2R) program.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
